import csv
#to write data to a csv file
def write_data(data,file_name):
	"""takes the data argument as a dictionary
	writes data in three rows, the first ellement of each row is the key of the array stored adter it"""
	dataWriter = csv.writer(open('/home/jackson/lab/lab.md-analysis/radial-bond_tests/data/'+file_name+'.csv', 'w'), delimiter=' ', quotechar='|',quoting=csv.QUOTE_MINIMAL)
	for i in range(len(data.keys())):
		a = data.keys()[i]
		b = [a]+data[a]
		dataWriter.writerow(b)

